import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

class Spinach extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      type :"Vegetables",
      name: "Spinach",
      quantity:200,

    };
  }
  render() {
    return (
      <div>
        <img src = "/images/spinach.jpeg" alt=""/>
        <ul>
          <li>Type:{this.state.type}</li>
          <li>Name:{this.state.name}</li>
          <li>Quantity:{this.state.quantity}</li>
        </ul>
      </div>
    );
  }
}

class Onions extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      type: "Vegetables",
      name: "Onions",
      quantity:300,

    };
  }
  render() {
    return (
      <div>
        <img src = "/images/onions.jpeg" alt="" />
        <ul>
          <li>Type:{this.state.type}</li>
          <li>Name:{this.state.name}</li>
          <li>Quantity:{this.state.quantity}</li>
        </ul>
      </div>
    );
  }
}

class Oranges extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      type: "Fruits",
      name: "Oranges",
      quantity:250,

    };
  }
  render() {
    return (
      <div>
        <ul>
          <li>Type:{this.state.type}</li>
          <li>Name{this.state.name}</li>
          <li>Quantity:{this.state.quantity}</li>
        </ul>
        <Spinach />
        <Onions />

      </div>
    );
  }
}

ReactDOM.render(<Oranges />,document.getElementById("root"))
